import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar';
import Profile from './components/Profile';

class App extends Component {
  render() {
    return (

            <div className='home_page'>
                <NavBar/>
                <Profile/>
            </div>
    )
  }
}

export default App;
